settings.exp_custom_css:
.techmate-call-to-action .eael-call-to-action .content{
    order: unset !important;
    justify-content: center;
}
.techmate-call-to-action .eael-call-to-action .action{
    position: relative;
}
.techmate-call-to-action .eael-call-to-action .action a::before {
	position: absolute;
	content: "";
	top: 0;
	left: 15px;
	height: 100%;
	width: 15%;
	background-image: url('http://techmate.expressosoft.com/wp-content/uploads/2019/09/btn-icon.png') !important;
	background-repeat: no-repeat !important;
	background-position: center !important;
	background-size: 70% !important;
	transition: transform 0.3s ease;
}
.techmate-call-to-action .eael-call-to-action .action a:hover::before{
    transform: rotate(-30deg)
}

.nsltr-frm .eael-form-fields-wrapper {
    display: flex;
}
.nsltr-frm .eael-field-group {
    width: 70%;
}

@media( max-width: 767px ){
    .nsltr-frm .eael-form-fields-wrapper {
    display: block;
}
.nsltr-frm .eael-field-group {
    width: 100%;
}
.nsltr-frm .eael-mailchimp-subscribe {
    width: 100% !important;
}
}
